export const GET_TASK = '[tasks] GET_TASKS';
export const TASK_SUCCESS = '[tasks] TASK_SUCCESS';
export const TASK_ERROR = '[tasks] TASK_ERROR';
export const TASK_LOADING = '[tasks] TASK_LOADING';


export const getTasks = (payload) =>({
  type: GET_TASK,
  payload
});

export const taskSuccess = (payload) =>({
  type: TASK_SUCCESS,
  payload
})

export const taskError = (payload) =>({
  type: GET_TASK,
  payload
})
